import React from 'react';
import './content_about.css';
import AboutJson from './content_about_json';


class ContentAbout extends React.Component{
  render(){
    return(
      <div id="contentabout" className="container-fluid">
           <div className="line"></div>
           <h1 className="abouth">How it works?</h1>
           <h6 className="abouth6">Step by step</h6>
         {AboutJson.map((item)=>{
           return(
             <div>
                <div dangerouslySetInnerHTML={{__html:item.text}}>
                </div>
                 <div className="col-12 text-center" dangerouslySetInnerHTML={{__html:item.span}}>
                 </div>
             </div>
           )
         }
         )}
      </div>
    )
  }
}
export default ContentAbout
